import { useParams } from "react-router-dom";

const DistrictPage = () => {
  const { district } = useParams();

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold">Welcome to {district}</h1>
      <p>Information about {district} will be displayed here.</p>
    </div>
  );
};

export default DistrictPage;
